-- ALGORITHM 테이블 생성
DROP TABLE IF EXISTS "ALGORITHM";
CREATE TABLE IF NOT EXISTS "ALGORITHM" ( 
	id BIGSERIAL NOT NULL 
	, name VARCHAR(100) NOT NULL 
	, library_name VARCHAR(100) NOT NULL 
	, library_version VARCHAR(50) 
	, library_document_url VARCHAR(200) 
	, library_object_name VARCHAR(50) NOT NULL 
	, library_function_name VARCHAR(50) NOT NULL 
	, library_function_description VARCHAR(500) 
	, library_function_usage VARCHAR(50) NOT NULL 
	, model_parameter TEXT NOT NULL 
	, train_parameter TEXT NOT NULL 
	, support_data_type VARCHAR(200) 
	, create_date TIMESTAMP NOT NULL 
	, writer VARCHAR(50) NOT NULL
	, use_flag BOOLEAN DEFAULT TRUE NOT null
	, type VARCHAR(5) NOT NULL
	, PRIMARY KEY(id) 
);
-- 코멘트 추가
COMMENT ON TABLE "ALGORITHM" IS '데이터 분석 시스템에서 사용할 수 있는 알고리즘';
COMMENT ON COLUMN "ALGORITHM".id IS '알고리즘 번호';
COMMENT ON COLUMN "ALGORITHM".name IS '알고리즘 이름';
COMMENT ON COLUMN "ALGORITHM".library_name IS '라이브러리 이름';
COMMENT ON COLUMN "ALGORITHM".library_version IS '라이브러리 버전';
COMMENT ON COLUMN "ALGORITHM".library_document_url IS '라이브러리 문서 URL';
COMMENT ON COLUMN "ALGORITHM".library_object_name IS '라이브러리 객체 이름';
COMMENT ON COLUMN "ALGORITHM".library_function_name IS '라이브러리 함수 이름';
COMMENT ON COLUMN "ALGORITHM".library_function_description IS '라이브러리 함수 설명';
COMMENT ON COLUMN "ALGORITHM".library_function_usage IS '라이브러리 함수 활용 용도';
COMMENT ON COLUMN "ALGORITHM".model_parameter IS '모델 파라미터';
COMMENT ON COLUMN "ALGORITHM".train_parameter IS '학습 파라미터';
COMMENT ON COLUMN "ALGORITHM".support_data_type IS '지원 데이터 종류';
COMMENT ON COLUMN "ALGORITHM".create_date IS '생성 일시';
COMMENT ON COLUMN "ALGORITHM".writer IS '작성자';
COMMENT ON COLUMN "ALGORITHM".use_flag IS '사용 가능 여부';
COMMENT ON COLUMN "ALGORITHM".type IS '알고리즘 종류 M-MachineLearning, D-DeepLearning';
