INSERT INTO "ALGORITHM" ( name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, model_parameter, train_parameter, support_data_type, create_date, writer, type) VALUES ('LinearRegression', 'sklearn', '0.21.3', 'https://scikit-learn.org/stable/modules/generated/sklearn.linear_model.LinearRegression.html', 'linear_model', 'LinearRegression', '종속변수와 한 개 이상의 독립변수의 선형 상관 관계를 모델링하는 회귀 모델', 'regression', '[{''name'':''fit_intercept'', ''default'':''TRUE'', ''type'':''bool'', ''note'':''절편을 계산할지 여부 '', ''enumeration'':''''}, {''name'':''normalize'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''True인 경우 회귀 X는 평균을 빼고 l2-norm으로 나누어 회귀 전에 정규화, fit_intercept가 False인 경우 무시 '', ''enumeration'':''''}, {''name'':''copy_X'', ''default'':''TRUE'', ''type'':''bool'', ''note'':''True인 경우 X가 복사, 그렇지 않으면 덮어쓸 수 있음 '', ''enumeration'':''''}, {''name'':''n_jobs'', ''default'':''None'', ''type'':''int'', ''note'':''계산에 사용할 작업 수, n_targets > 1 이며 충분히 큰 문제에서 속도를 향상 '', ''enumeration'':''''}]', '[{''name'':''X'', ''default'':'''', ''type'':''array-like, sparse matrix'', ''note'':''학습용 입력 데이터 [n_samples, n_features]''}, {''name'':''y'', ''default'':'''', ''type'':''array-like'', ''note'':''대상 값 [n_samples, n_targets]''}, {''name'':''sample_weight'', ''default'':''None'', ''type'':''array-like'', ''note'':''각 샘플의 가중치 [n_samples], None''}]', 'numeric, string', NOW(), 'daumsoft', 'M');
INSERT INTO "ALGORITHM" ( name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, model_parameter, train_parameter, support_data_type, create_date, writer, type) VALUES ('LogisticRegression', 'sklearn', '0.21.3', 'https://scikit-learn.org/stable/modules/generated/sklearn.linear_model.LogisticRegression.html', 'linear_model', 'LogisticRegression', '독립 변수의 선형 결합을 이용하여 사건의 발생 가능성을 예측하는데 사용되는 이진 분류 모델', 'classification', '[{''name'':''penalty'', ''default'':''l2'', ''type'':''string'', ''note'':''penalization에 사용될 개념 l1,l2,elasticnet,None'', ''enumeration'':''l1,l2,elasticnet,None''}, {''name'':''dual'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''dual, primal형식, dual 형식은 l2 penalty에서만 구현 '', ''enumeration'':''''}, {''name'':''tol'', ''default'':''0.0001'', ''type'':''float'', ''note'':''중단에 대한 허용 오차 '', ''enumeration'':''''}, {''name'':''C'', ''default'':''1'', ''type'':''float'', ''note'':''정규화 강도의 역, 작을수록 더 강한 정규화 '', ''enumeration'':''''}, {''name'':''fit_intercept'', ''default'':''TRUE'', ''type'':''bool'', ''note'':''결정 함수에 상수(bias)를 추가할지에 대한 여부 '', ''enumeration'':''''}, {''name'':''intercept_scaling'', ''default'':''1'', ''type'':''float'', ''note'':''x는 intercept_scaling과 동일한 상수 값을 가진 "합성"기능이 인스턴스 벡터에 추가, 솔버에 liblinear가 사용되고 fit_intercept가 True일 경우에만 유용 '', ''enumeration'':''''}, {''name'':''class_weight'', ''default'':''None'', ''type'':''dict, string'', ''note'':''{class_label : weight} 형식의 클래스와 연관된 가중치 balanced,None'', ''enumeration'':''balanced,None''}, {''name'':''random_state'', ''default'':''None'', ''type'':''int'', ''note'':''확률 추정을 위해 데이터를 섞을 때 사용되는 의사 난수 생성기의 시드, int는 난수 생성기에서 사용하는 seed, 만약 None이면 난수 생성기는 np.random에서 사용하는 인스턴스를 사용 '', ''enumeration'':''''}, {''name'':''solver'', ''default'':''warn'', ''type'':''string'', ''note'':''최적화 문제에 사용할 알고리즘 newton-cg,lbfgs,liblinear,sag,saga'', ''enumeration'':''newton-cg,lbfgs,liblinear,sag,saga''}, {''name'':''max_iter'', ''default'':''100'', ''type'':''int'', ''note'':''solver가 수렴하는데 걸린 최대 반복 횟수 '', ''enumeration'':''''}, {''name'':''multi_class'', ''default'':''warn'', ''type'':''string'', ''note'':''이진문제인지 다항문제인지를 결정 ovr,multinomial,auto'', ''enumeration'':''ovr,multinomial,auto''}, {''name'':''verbose'', ''default'':''0'', ''type'':''int'', ''note'':''liblinear 및 lbfgs 솔버의 경우 verbose를 자세한 양수로 설정 '', ''enumeration'':''''}, {''name'':''warm_start'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''True일 경우 이전 호출의 solution을 재사용해서 초기화 '', ''enumeration'':''''}, {''name'':''n_jobs'', ''default'':''None'', ''type'':''int'', ''note'':''multi_class = ovr인 경우 클래스를 병렬 처리 할 때 사용되는 CPU 코어 수 '', ''enumeration'':''''}, {''name'':''l1_ration'', ''default'':''None'', ''type'':''float'', ''note'':''0 <= l1_ratio <= 1 을 가지는 Elastic-Net의 혼합 매개변수, penalty=elasticnet, l1_ratio=0인 경우에만 사용 '', ''enumeration'':''''}]', '[{''name'':''X'', ''default'':'''', ''type'':''array-like, sparse matrix'', ''note'':''학습용 입력 데이터 [n_samples, n_features]''}, {''name'':''y'', ''default'':'''', ''type'':''array-like'', ''note'':''대상 값 [n_samples]''}, {''name'':''sample_weight'', ''default'':''None'', ''type'':''array-like'', ''note'':''각 샘플의 가중치 배열 [n_samples], None''}]', 'numeric, string', NOW(), 'daumsoft', 'M');
INSERT INTO "ALGORITHM" ( name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, model_parameter, train_parameter, support_data_type, create_date, writer, type) VALUES ('Lasso', 'sklearn', '0.21.3', 'https://scikit-learn.org/stable/modules/generated/sklearn.linear_model.Lasso.html', 'linear_model', 'Lasso', 'LinearRegression의 손실함수에 L1 regularization을 추가한 회귀 모델', 'regression', '[{''name'':''alpha'', ''default'':''1'', ''type'':''float'', ''note'':''L1항을 곱하는 상수, 0일 경우 LinearRegression의 OLS와 같다. '', ''enumeration'':''''}, {''name'':''fit_intercept'', ''default'':''TRUE'', ''type'':''bool'', ''note'':''절편을 계산할지 여부 '', ''enumeration'':''''}, {''name'':''nomalize'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''True인 경우 회귀 X는 평균을 빼고 l2-norm으로 나누어 회귀 전에 정규화, fit_intercept가 False인 경우 무시 '', ''enumeration'':''''}, {''name'':''percompute'', ''default'':''FALSE'', ''type'':''bool, array-like'', ''note'':''미리 계산 된 Gram 행렬을 사용하여 계산 속도를 높일 지 여부 '', ''enumeration'':''''}, {''name'':''copy_X'', ''default'':''TRUE'', ''type'':''bool'', ''note'':''True인 경우 X가 복사, 그렇지 않으면 덮어쓸 수 있음 '', ''enumeration'':''''}, {''name'':''max_iter'', ''default'':''1000'', ''type'':''int'', ''note'':''최대 반복 횟수 '', ''enumeration'':''''}, {''name'':''tol'', ''default'':''0.0001'', ''type'':''float'', ''note'':''최적화에 대한 허용 오차 '', ''enumeration'':''''}, {''name'':''warm_start'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''True일 경우 이전 호출의 solution을 재사용해서 초기화 '', ''enumeration'':''''}, {''name'':''positive'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''True일 경우 계수를 양수로 만듬 '', ''enumeration'':''''}, {''name'':''random_state'', ''default'':''None'', ''type'':''int'', ''note'':''확률 추정을 위해 데이터를 섞을 때 사용되는 의사 난수 생성기의 시드, int는 난수 생성기에서 사용하는 seed, 만약 None이면 난수 생성기는 np.random에서 사용하는 인스턴스를 사용 '', ''enumeration'':''''}, {''name'':''selection'', ''default'':''cyclic'', ''type'':''string'', ''note'':''랜덤으로 설정하면 임의의 계수가 기본적으로 피쳐를 순차적으로 반복하지 않고 반복마다 업데이트 cyclic,random'', ''enumeration'':''cyclic,random''}]', '[{''name'':''X'', ''default'':'''', ''type'':''array-like, sparse matrix'', ''note'':''학습용 입력 데이터 [n_samples, n_features]''}, {''name'':''y'', ''default'':'''', ''type'':''array-like'', ''note'':''대상 값 [n_samples], [n_samples, n_targets]''}, {''name'':''check_input'', ''default'':''TRUE'', ''type'':''bool'', ''note'':''input checking의 우회 여부 ''}]', 'numeric, string', NOW(), 'daumsoft', 'M');
