nt'', ''note'':''solver 내 iteration에 대한 제한 또는 제한이 없는 경우 -1 '', ''enumeration'':''''}, {''name'':''decision_function_shape'', ''default'':''ovr'', ''type'':''string'', ''note'':''(n_samples, n_classes)의 모양을 반환하는 ovr 결정함수를 쓸지 (n_samples, n_classes * (n_classes - 1) / 2)의 모양을 반환하는 ovo 결정함수를 쓸지에 대한 여부 ovo,ovr'', ''enumeration'':''ovo,ovr''}, {''name'':''random_state'', ''default'':''None'', ''type'':''int'', ''note'':''확률 추정을 위해 데이터를 섞을 때 사용되는 의사 난수 생성기의 시드 '', ''enumeration'':''''}]', '[{''name'':''X'', ''default'':'''', ''type'':''array-like, sparse matrix'', ''note'':''학습용 입력 데이터 [n_samples, n_features]''}, {''name'':''y'', ''default'':'''', ''type'':''array-like'', ''note'':''대상 값 [n_samples]''}, {''name'':''sample_weight'', ''default'':''None'', ''type'':''array-like'', ''note'':''각 샘플의 가중치 [n_samples], None''}]', 'numeric, string', NOW(), 'daumsoft', 'M');
