INSERT INTO "ALGORITHM" ( name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, model_parameter, train_parameter, support_data_type, create_date, writer, type) VALUES ('GradientBoostingClassifier', 'sklearn', '0.21.3', 'https://scikit-learn.org/stable/modules/generated/sklearn.ensemble.GradientBoostingClassifier.html', 'ensemble', 'GradientBoostingClassifier', '여러 의사 결정 나무를 이용한 앙상블 기법 중 하나이며 이전 의사 결정 나무의 오차를 보완하는 의사 결정 나무를 만들어 합하는 방식으로 학습하는 분류 모델', 'classification', '[{''name'':''loss'', ''default'':''deviance'', ''type'':''string'', ''note'':''deviance는 확률적 결과로 분류하기 위한 로지스틱 회귀를 나타냄, exponential은 손실에 대해 지수 그래디언트 부스팅으로 AdaBoost 알고리즘 복구 deviance,exponential'', ''enumeration'':''deviance,exponential''}, {''name'':''learning_rate'', ''default'':''0.1'', ''type'':''float'', ''note'':''학습률 '', ''enumeration'':''''}, {''name'':''n_estimators'', ''default'':''100'', ''type'':''int'', ''note'':''수행 할 부스팅 단계 수 '', ''enumeration'':''''}, {''name'':''subsample'', ''default'':''1'', ''type'':''float'', ''note'':''개별 기본 학습자를 맞추는 데 사용되는 샘플의 비율, 1보다 작으면 Stochastic Gradient Boosting '', ''enumeration'':''''}, {''name'':''criterion'', ''default'':''friedman_mse'', ''type'':''string'', ''note'':''분할의 질을 측정하는 함수 friedman_mse,mse,mae'', ''enumeration'':''friedman_mse,mse,mae''}, {''name'':''min_samples_split'', ''default'':''2'', ''type'':''int, float'', ''note'':''내부 노드를 분할 하는데 필요한 최소 샘플 수 '', ''enumeration'':''''}, {''name'':''min_samples_leaf'', ''default'':''1'', ''type'':''int, float'', ''note'':''잎사귀 노드가 요구하는 최소 샘플 수 '', ''enumeration'':''''}, {''name'':''min_weight_fraction_leaf'', ''default'':''0'', ''type'':''float'', ''note'':''잎사귀 노드에 있어야 하는 (모든 입력 샘플의) 총 가중치의 최소 가중 비율 '', ''enumeration'':''''}, {''name'':''max_depth'', ''default'':''3'', ''type'':''int'', ''note'':''개별 회귀 추정기의 최대 깊이 '', ''enumeration'':''''}, {''name'':''min_impurity_decrease'', ''default'':''0'', ''type'':''float'', ''note'':''분할이 impurity을 지정한 값 이상으로 감소시키면 노드 분할 '', ''enumeration'':''''}, {''name'':''min_impurity_split'', ''default'':''None'', ''type'':''float'', ''note'':''나무의 빠른 중단에 대한 임계값 '', ''enumeration'':''''}, {''name'':''init'', ''default'':''None'', ''type'':''string'', ''note'':''초기 예측을 계산하는데 사용되는 추정기 zero,None'', ''enumeration'':''zero,None''}, {''name'':''random_state'', ''default'':''None'', ''type'':''int'', ''note'':''확률 추정을 위해 데이터를 섞을 때 사용되는 의사 난수 생성기의 시드, int는 난수 생성기에서 사용하는 seed, 만약 None이면 난수 생성기는 np.random에서 사용하는 인스턴스를 사용 '', ''enumeration'':''''}, {''name'':''max_features'', ''default'':''None'', ''type'':''int, float, string'', ''note'':''최적의 분할을 찾을 때 고려해야 할 features 수 auto,sqrt,log2,None'', ''enumeration'':''auto,sqrt,log2,None''}, {''name'':''verbose'', ''default'':''0'', ''type'':''int'', ''note'':''자세한 출력 사용 '', ''enumeration'':''''}, {''name'':''max_leaf_nodes'', ''default'':''None'', ''type'':''int'', ''note'':''잎사귀 노드의 성장 상한선 '', ''enumeration'':''''}, {''name'':''warm_start'', ''default'':''FALSE'', ''type'':''bool'', ''note'':''True일 경우 이전 호출의 solution을 재사용해서 초기화 '', ''enumeration'':''''}, {''name'':''presort'', ''default'':''auto'', ''type'':''bool, string'', ''note'':''최적의 분할을 찾는 속도를 높이기 위해 데이터를 미리 정렬할지에 대한 여부 auto'', ''enumeration'':''auto''}, {''name'':''validation_fraction'', ''default'':''0.1'', ''type'':''float'', ''note'':''조기 중지를 위해 validation data로 따로 설정할 training data의 비율 '', ''enumeration'':''''}, {''name'':''n_iter_no_change'', ''default'':''None'', ''type'':''int'', ''note'':''유효성 검사 점수가 향상 되지 않을 때 조기 중지를 사용하여 교육을 종료할지에 대한 여부를 결정할 때 사용 '', ''enumeration'':''''}, {''name'':''tol'', ''default'':''0.0001'', ''type'':''float'', ''note'':''조기 중단에 대한 허용 오차 '', ''enumeration'':''''}]', '[{''name'':''X'', ''default'':'''', ''type'':''array-like, sparse matrix'', ''note'':''학습용 입력 데이터 [n_samples, n_features]''}, {''name'':''y'', ''default'':'''', ''type'':''array-like'', ''note'':''대상 값 [n_samples]''}, {''name'':''sample_weight'', 