INSERT INTO public."NEURAL_LAYER" (id, name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, create_date, writer) VALUES (7, 'Dense', 'tensorflow', '2.1.0', 'https://www.tensorflow.org/versions/r2.1/api_docs/python/tf/keras/layers/Dense', 'keras.layers', 'Dense', '조밀하게 연결된 뉴럴 네트워크 레이어, =Fully Connected Layer', 'Core', '[{"name":"units","default":"","type":"int","note":"출력의 차원 수, 필수 입력 값","enumeration":""},{"name":"activation","default":"None","type":"string","note":"사용할 활성 함수, 만약 None일 경우 선형 함수","enumeration":""},{"name":"use_bias","default":"TRUE","type":"bool","note":"편차를 사용할지에 대한 여부","enumeration":""},{"name":"kernel_initializer","default":"glorot_uniform","type":"string","note":"커널가중치 행렬의 초기자","enumeration":"glorot_uniform"},{"name":"bias_initializer","default":"zeros","type":"string","note":"편차에 대한 초기자","enumeration":"zeros"},{"name":"kernel_regularizer","default":"None","type":"string","note":"커널 가중치 행렬에 적용할 정규화 함수","enumeration":""},{"name":"bias_regularizer","default":"None","type":"string","note":"편차에 적용할 정규화 함수","enumeration":""},{"name":"activity_regularizer","default":"None","type":"string","note":"레이어의 출력에 적용할 정규화 함수","enumeration":""},{"name":"kernel_constraint","default":"None","type":"string","note":"커널 가중치 행렬에 적용할 규제 함수","enumeration":""},{"name":"bias_constraint","default":"None","type":"string","note":"편차에 적용할 규제 함수","enumeration":""}]', NOW(), 'daumsoft');
INSERT INTO public."NEURAL_LAYER" (id, name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, create_date, writer) VALUES (8, 'Flatten', 'tensorflow', '2.1.0', 'https://www.tensorflow.org/versions/r2.1/api_docs/python/tf/keras/layers/Flatten', 'keras.layers', 'Flatten', '입력을 평평하게 할 때 사용', 'Reshaping', '[{"name":"data_format","default":"None","type":"string","note":"모델을 하나의 데이터 형식에서 다른 형식으로 바꿀 때 가중치 순서를 보존할 때의 기준, None은 (batch,…,channels)형태에 호응, channels_first는 (batch,channels,…)형태에 호응","enumeration":"None, channels_first"}]', NOW(), 'daumsoft');
INSERT INTO public."NEURAL_LAYER" (id, name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, create_date, writer) VALUES (9, 'UpSampling2D', 'tensorflow', '2.1.0', 'https://www.tensorflow.org/versions/r2.1/api_docs/python/tf/keras/layers/UpSampling2D', 'keras.layers', 'UpSampling2D', '2D 입력을 위한 업 샘플링 레이어', 'Reshaping', '[{"name":"size","default":"(2, 2)","type":"int, tuple of int","note":"행과 열의 업샘플링 계수","enumeration":""},{"name":"data_format","default":"None","type":"string","note":"None인 경우 (batch_size, 높이, 너비, 채널)의 입력에 호응하고 channels_first인 경우 (batch_size, 채널, 높이, 너비)의 입력에 호응","enumeration":"None, channels_first"},{"name":"interpolation","default":"nearest","type":"string","note":"nearest와 bilinear중 하나","enumeration":"nearest,bilinear"}]', NOW(), 'daumsoft');
INSERT INTO public."NEURAL_LAYER" (id, name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, create_date, writer) VALUES (10, 'ZeroPadding2D', 'tensorflow', '2.1.0', 'https://www.tensorflow.org/versions/r2.1/api_docs/python/tf/keras/layers/ZeroPadding2D', 'keras.layers', 'ZeroPadding2D', '2D 입력을위한 제로 패딩 레이어 (예 : 사진)', 'Reshaping', '[{"name":"padding","default":"(1,1)","type":"int, tuple of int","note":"int인 경우 높이와 너비에 동일한 패딩을 적용, 2개 정수의 튜플인 경우 (symmetric_height_pad, symmetric_width_pad) 2개 정수의 튜플2개로 이루어진 튜플인 경우 ((top_pad, bottom_pad), (left_pad, right_pad))로 패딩","enumeration":""},{"name":"data_format","default":"None","type":"string","note":"None인 경우 (batch_size, 높이, 너비, 채널)의 입력에 호응하고 channels_first인 경우 (batch_size, 채널, 높이, 너비)의 입력에 호응","enumeration":"None, channels_first"}]', NOW(), 'daumsoft');
INSERT INTO public."NEURAL_LAYER" (id, name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, create_date, writer) VALUES (11, 'BatchNormalization', 'tensorflow', '2.1.0', 'https://www.tensorflow.org/versions/r2.1/api_docs/python/tf/keras/layers/BatchNormalization', 'keras.layers', 'BatchNormalization', '입력 또는 활성화를 정규화하고 스케일링할 때 사용', 'Normalization', '[{"name":"axis","default":"-1","type":"int","note":"정규화 되어야 하는 축","enumeration":""},{"name":"momentum","default":"0.99","type":"float","note":"이동 평균 및 이동 분산에 대한 모멘텀","enumeration":""},{"name":"epsilon","default":"0.001","type":"float","note":"0으로 나누기를 방지하기 위해 분산에 추가되는 작은 값","enumeration":""},{"name":"center","default":"TRUE","type":"bool","note":"True인 경우 정규화된 텐서에 beta만큼의 거리를 추가, Fasle인 경우 beta는 무시","enumeration":""},{"name":"scale","default":"TRUE","type":"bool","note":"True인 경우 gamma를 곱함, False인 경우 gamma는 사용되지 않음","enumeration":""},{"name":"beta_initializer","default":"zeros","type":"string","note":"beta 가중치를 위한 초기값 설정기","enumeration":"zeros"},{"name":"gamma_initializer","default":"ones","type":"string","note":"gamma 가중치를 위한 초기값 설정기","enumeration":""},{"name":"moving_mean_initializer","default":"zeros","type":"string","note":"이동 평균을 위한 초기값 설정기","enumeration":"zeros"},{"name":"moving_variance_initializer","default":"ones","type":"string","note":"이동 분산을 위한 초기값 설정기","enumeration":""},{"name":"beta_regularizer","default":"None","type":"string","note":"beta 가중치를 위해 선택적으로 사용 가능한 규제기","enumeration":""},{"name":"gamma_regularizer","default":"None","type":"string","note":"gamma 가중치를 위해 선택적으로 사용 가능한 규제기","enumeration":""},{"name":"beta_constraint","default":"None","type":"string","note":"beta 가중치를 위해 선택적으로 적용 가능한 규제조건","enumeration":""},{"name":"gamma_constraint","default":"None","type":"string","note":"gamma 가중치를 위해 선택적으로 사용 가능한 규제조건","enumeration":""},{"name":"renorm","default":"FALSE","type":"bool","note":"배치 재 정규화 사용 여부","enumeration":""},{"name":"renorm_clipping","default":"None","type":"string","note":"rmax, rmin, dmax키를 renorm 보정에 사용되는 스칼라Tensor에 매핑할 수 있는 사전","enumeration":""},{"name":"renorm_momentum","default":"0.99","type":"float","note":"재 정규화에 사용할 이동 평균 및 이동 분산에 대한 모멘텀","enumeration":""},{"name":"fused","default":"None","type":"bool, string","note":"True인 경우 faster fused implementation을 사용하거나 사용하지 못할 경우 ValueError를 발생, None인 경우 가능하면 faster fused implementation을 사용, False인 경우 fused implementation을 사용하지 않음","enumeration":"None, True, False"},{"name":"trainable","default":"True","type":"bool","note":"True일 경우 변수가 학습 가능으로 표시","enumeration":""},{"name":"virtual_batch_size","default":"None","type":"int, string","note":"None일 경우 배치 정규화가 전체 배치에서 수행, None이 아닐경우 Ghost 배치 정규화 수행하여 각각 개별적으로 정규화 된 가상 하위 배치를 생성","enumeration":"None"},{"name":"adjustment","default":"None","type":"string","note":"입력 텐서의 모양을 포함하는 텐서를 가져와서 훈련중에만 정규화 된 값에 적용하기 위해 스케일, 바이어스를 반환","enumeration":""}]', NOW(), 'daumsoft');
