INSERT INTO public."NEURAL_LAYER" (id, name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, create_date, writer) VALUES (13, 'MaxPooling2D', 'tensorflow', '2.1.0', 'https://www.tensorflow.org/versions/r2.1/api_docs/python/tf/keras/layers/MaxPooling2D', 'keras.layers', 'MaxPooling2D', '2D 공간 데이터에 대한 max pooling', 'Pooling', '[{"name":"pool_size","default":"(2, 2)","type":"int, tuple of int","note":"최대값 풀링 윈도우 각각의 차원별 크기, int인 경우 모든 차원에서 동일한 풀링 윈도우의 크기","enumeration":""},{"name":"strides","default":"None","type":"string, int, tuple of int","note":"풀링 윈도우가 한번에 얼마나 이동하는지 지정, tuple of int로 각 차원마다 지정 가능, None일경우 pool_size가 기본값","enumeration":"None"},{"name":"padding","default":"valid","type":"string","note":"vaild인 경우 패딩을 하지 않고 same인 경우 입력과 출력의 크기가 같게 패딩","enumeration":"valid, same"},{"name":"data_format","default":"None","type":"string","note":"None인 경우 (batch, height, width, channels)의 입력에 호응, channels_first인 경우 (batch, channels, height, width)의 입력에 호응","enumeration":"None, channels_first"}]', NOW(), 'daumsoft');
