izer","default":"None","type":"string","note":"포인트별 커널 행렬에 적용되는 정규화 함수","enumeration":""},{"name":"bias_regularizer","default":"None","type":"string","note":"편차에 적용할 정규화 함수","enumeration":""},{"name":"activity_regularizer","default":"None","type":"string","note":"레이어의 출력에 적용할 정규화 함수","enumeration":""},{"name":"depthwise_constraint","default":"None","type":"string","note":"깊이별 커널 행렬에 적용되는 규제 함수","enumeration":""},{"name":"pointwise_constraint","default":"None","type":"string","note":"포인트별 커널 행렬에 적용되는 규제 함수","enumeration":""},{"name":"bias_constraint","default":"None","type":"string","note":"편차에 적용할 규제 함수","enumeration":""}]', NOW(), 'daumsoft');
