-- PREPROCESS_FUNCTION 테이블 생성
DROP TABLE IF EXISTS "PREPROCESS_FUNCTION";
CREATE TABLE IF NOT EXISTS "PREPROCESS_FUNCTION" (
	id BIGSERIAL NOT NULL
	, name VARCHAR(100) NOT NULL
	, library_name VARCHAR(100) NOT NULL
	, library_version VARCHAR(50)
	, library_document_url VARCHAR(200)
	, library_object_name VARCHAR(50) NOT NULL
	, library_function_name VARCHAR(50) NOT NULL
	, library_function_description VARCHAR(500)
	, library_function_usage VARCHAR(50) NOT NULL
	, parameter TEXT NOT NULL
	, support_data_type VARCHAR(200)
	, create_date TIMESTAMP NOT NULL
	, writer VARCHAR(50) NOT NULL
	, use_flag BOOLEAN DEFAULT TRUE NOT NULL
	, valid_check VARCHAR(1000) NOT NULL
	, PRIMARY KEY(id)
);
-- 코멘트 추가
COMMENT ON TABLE "PREPROCESS_FUNCTION" IS '데이터 분석 시스템에서 사용할 수 있는 전처리 함수';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".id IS '전처리 함수 번호';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".name IS '전처리 함수 이름';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_name IS '라이브러리 이름';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_version IS '라이브러리 버전';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_document_url IS '라이브러리 문서 URL';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_object_name IS '라이브러리 객체 이름';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_function_name IS '라이브러리 함수 이름';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_function_description IS '라이브러리 함수 설명';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".library_function_usage IS '라이브러리 함수 활용 용도';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".parameter IS '파라미터';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".support_data_type IS '지원 데이터 종류';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".create_date IS '생성 일시';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".writer IS '작성자';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".use_flag IS '사용 가능 여부';
COMMENT ON COLUMN "PREPROCESS_FUNCTION".valid_check IS '전처리 기능 유효 검사';
-- 삽입
INSERT INTO "PREPROCESS_FUNCTION" ( name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, support_data_type, create_date, writer, valid_check) VALUES ('StandardScaler', 'sklearn', '0.21.3', 'https://scikit-learn.org/stable/modules/generated/sklearn.preprocessing.StandardScaler.html', 'preprocessing', 'StandardScaler', '변수를 평균이 0, 분산이 1이 되도록 스케일링하는 함수(기본 스케일링 함수)', 'Numerical Transformer (Scaling)', '[{''name'':''with_mean'', ''default'':''True'', ''type'':''bool'', ''note'':''true인 경우 스케일링 전 데이터를 중심에 둠 '', ''enumerate'':''''}, {''name'':''with_std'', ''default'':''True'', ''type'':''bool'', ''note'':''true인 경우 데이터를 단위 분산으로 조정 '', ''enumerate'':''''}]', 'numeric, string', NOW(), 'daumsoft', '{"request_test":[{"field_name":"_changeMe","preprocess_function_id":"1"}]}');
INSERT INTO "PREPROCESS_FUNCTION" ( name, library_name, library_version, library_document_url, library_object_name, library_function_name, library_function_description, library_function_usage, parameter, support_data_type, create_date, writer, valid_check) VALUES ('MinMaxScaler', 'sklearn', '0.21.3', 'https://scikit-learn.org/stable/modules/generated/sklearn.preprocessing.MinMaxScaler.html', 'preprocessing', 'MinMaxScaler', '변수의 최대, 최소값이 feature_range 파라미터에서 설정한 범위(기본은 0과 1)가 되도록 스케일링하는 함수', 'Numerical Transformer (Scaling)', '[{''name'':''feature_range'', ''default'':''(0, 1)'', ''type'':''tuple'', ''note'':''변형된 데이터의 원하는 범위 [min, max]'', ''enumerate'':''''}]', 'numeric, string', NOW(), 'daumsoft', '{"request_test":[{"field_name":"_changeMe","preprocess_function_id":"2"}]}');
