INSERT INTO public."PRETRAINED_NETWORK" (id, neural_network, number_of_layer, size, number_of_class, number_of_parm, description, architecture) VALUES (1, 'DenseNet121', 426, 27, 1000, 7, 'DenseNet은 conv-ReLU-conv 사이만 뛰어넘는 지름길을 만들었던 ResNet에서 한발 더 나아가 전체 네트워크의 모든 층과 통하는 지름길을 만들었다. 레이어의 갯수에 따라 DenseNet121/169/201로 나뉜다. ImageNet으로 학습한 가중치를 이용한다. 자세한 내용은 ''Densely Connected Convolutional Networks'' 논문에서 확인할 수 있다.', '[{"Layer": 1, "Name": "zero_padding2d_38", "Type": "ZeroPadding2D", "Trainable": "False"}, {"Layer": 2, "Name": "conv1/conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 3, "Name": "conv1/bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 4, "Name": "conv1/relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 5, "Name": "zero_padding2d_39", "Type": "ZeroPadding2D", "Trainable": "False"}, {"Layer": 6, "Name": "pool1", "Type": "MaxPooling2D", "Trainable": "False"}, {"Layer": 7, "Name": "conv2_block1_0_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 8, "Name": "conv2_block1_0_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 9, "Name": "conv2_block1_1_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 10, "Name": "conv2_block1_1_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 11, "Name": "conv2_block1_1_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 12, "Name": "conv2_block1_2_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 13, "Name": "conv2_block1_concat", "Type": "Concatenate", "Trainable": "False"}, {"Layer": 14, "Name": "conv2_block2_0_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 15, "Name": "conv2_block2_0_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 16, "Name": "conv2_block2_1_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 17, "Name": "conv2_block2_1_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 18, "Name": "conv2_block2_1_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 19, "Name": "conv2_block2_2_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 20, "Name": "conv2_block2_concat", "Type": "Concatenate", "Trainable": "False"}, {"Layer": 21, "Name": "conv2_block3_0_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 22, "Name": "conv2_block3_0_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 23, "Name": "conv2_block3_1_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 24, "Name": "conv2_block3_1_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 25, "Name": "conv2_block3_1_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 26, "Name": "conv2_block3_2_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 27, "Name": "conv2_block3_concat", "Type": "Concatenate", "Trainable": "False"}, {"Layer": 28, "Name": "conv2_block4_0_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 29, "Name": "conv2_block4_0_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 30, "Name": "conv2_block4_1_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 31, "Name": "conv2_block4_1_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 32, "Name": "conv2_block4_1_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 33, "Name": "conv2_block4_2_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 34, "Name": "conv2_block4_concat", "Type": "Concatenate", "Trainable": "False"}, {"Layer": 35, "Name": "conv2_block5_0_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 36, "Name": "conv2_block5_0_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 37, "Name": "conv2_block5_1_conv", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 38, "Name": "conv2_block5_1_bn", "Type": "BatchNormalization", "Trainable": "False"}, {"Layer": 39, "Name": "conv2_block5_1_relu", "Type": "Activation", "Trainable": "False"}, {"Layer": 40, "Name": "conv2_block5_2_conv", "Type": "Conv2D", "Trainable": "False"}, {"L