INSERT INTO public."PRETRAINED_NETWORK" (id, neural_network, number_of_layer, size, number_of_class, number_of_parm, description, architecture) VALUES (16, 'VGG16', 18, 56, 1000, 15, 'VGGNet은 옥스포드 대학의 연구팀 VGG에 의해 개발되어 2014년 이미지넷 이미지 인식 대회에서 준우승한 모델이다. 레이어의 갯수에 따라 VGG16/19로 나뉜다. ImageNet으로 학습한 가중치를 이용한다. 자세한 내용은 ''Very deep convolutional networks for large-scale image recognition'' 논문에서 확인할 수 있다.', '[{"Layer": 1, "Name": "block1_conv1", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 2, "Name": "block1_conv2", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 3, "Name": "block1_pool", "Type": "MaxPooling2D", "Trainable": "False"}, {"Layer": 4, "Name": "block2_conv1", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 5, "Name": "block2_conv2", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 6, "Name": "block2_pool", "Type": "MaxPooling2D", "Trainable": "False"}, {"Layer": 7, "Name": "block3_conv1", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 8, "Name": "block3_conv2", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 9, "Name": "block3_conv3", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 10, "Name": "block3_pool", "Type": "MaxPooling2D", "Trainable": "False"}, {"Layer": 11, "Name": "block4_conv1", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 12, "Name": "block4_conv2", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 13, "Name": "block4_conv3", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 14, "Name": "block4_pool", "Type": "MaxPooling2D", "Trainable": "False"}, {"Layer": 15, "Name": "block5_conv1", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 16, "Name": "block5_conv2", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 17, "Name": "block5_conv3", "Type": "Conv2D", "Trainable": "False"}, {"Layer": 18, "Name": "block5_pool", "Type": "MaxPooling2D", "Trainable": "False"}]');
