COMMENT ON COLUMN "PROJECT".description IS '프로젝트 설명';
COMMENT ON COLUMN "PROJECT".type IS '프로젝트 종류 M-MachineLearning, D-DeepLearning';
COMMENT ON COLUMN "PROJECT".type_detail IS '프로젝트 종류 상세';
COMMENT ON COLUMN "PROJECT".create_date IS '생성 일시';
COMMENT ON COLUMN "PROJECT".delete_flag IS '프로젝트 삭제 여부';

